const { ObjectId } = require('mongodb');

require('dotenv').config()


export default {
  Query: {
    expenseByName: (root, args) => {
      return new Promise((resolve, reject) => {
        Expense.findOne(args).exec((err, res) => {
          err ? reject(err) : resolve(res);
        });
      });
    },
    expenses: () => {
      return new Promise((resolve, reject) => {
        Expense.find({})
          .populate()
          .exec((err, res) => {
            err ? reject(err) : resolve(res);
          });
      });
    }
